import React from 'react';
import {BrowserRouter, Route, Switch} from "react-router-dom";

const App = () =>
    <>
        <BrowserRouter>
            <Switch>
                <Route exact path="/" component={Login}/>
                <Route path="/home" component={Home}/>
            </Switch>
        </BrowserRouter>
    </>;

export default App;
